import React from 'react';
import styled from 'styled-components';

const BarContainer = styled.div`
    border:1px solid black;

    height:50px;
`;

const BtnContainer = styled.div`
    width:30%;
    height:100%;
    float:left;

    display:flex;
    align-items:center;
`;

const PageDotContainer = styled.div`
    float:center;
`;

const ContentInfoBar = () => {
    return(
        <BarContainer>
            <BtnContainer>
                this is a button
            </BtnContainer>
            <PageDotContainer>
            this is a bar;
            this is a bar;
            </PageDotContainer>
        </BarContainer>
    );
};

export default ContentInfoBar;
